import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'tailwind-web';
}

import { Component, Input } from "@angular/core"

type FontFamily =
  | 'font-sans'
  | 'font-serif'
  | 'font-mono';

@Component({
  selector: 'brown-fox',
  template: `<div class="space-y-5" >
  <div class="inline-block p-3 bg-white shadow rounded-lg">
    <h3 class="text-xs leading-5 font-mono pb-2 border-b border-gray-100">font-sans</h3>
    <p class="mt-2 sm:mt-3 lg:mt-2 xl:mt-3 text-gray-700 text-sm leading-6 lg:leading-6"
      [class.font-serif]="isSerif"
      [class.font-sans]="isSans"
      [class.font-mono]="isMono"
      [ngClass]="{
        'sm:text-lg lg:text-sm xl:text-lg': !isMono,
        'sm:leading-7 xl:leading-7': isMono
      }" 
    >{{text}}</p>
  </div>
</div>`
})
export default class BrownFoxComponent {
  /**
   * What text should the paragraph display?
   */
  @Input()
  text = 'The quick brown fox jumps over the lazy dog.';

  /**
   * What font family should the text be?
   */
  @Input()
  fontFamily: FontFamily = 'font-sans';

  get isSans() {
    return this.fontFamily === 'font-sans';
  }

  get isSerif() {
    return this.fontFamily === 'font-serif';
  }

  get isMono() {
    return this.fontFamily === 'font-mono';
  }
}

import { Component, EventEmitter, Input, Output } from '@angular/core';
import * as Shopping from '../shopping';


@Component({
  selector: 'simple',
  templateUrl: './brutalist.component.html',
  styleUrls: ['./brutalist.component.scss']
})
export default class BrutalistComponent {
  @Input()
  product!: Shopping.Product;

  @Input()
  selectedSize!: Shopping.Size;

  @Output()
  addToFavorites = new EventEmitter<Event>();

  @Output()
  buyNow = new EventEmitter<Event>();

  @Output()
  addToBag = new EventEmitter<Event>();
}

import { Component, Input, Output, EventEmitter } from '@angular/core';
import {BooleanInput, coerceBooleanProperty} from '@angular/cdk/coercion';

type ButtonSize = 'small' | 'medium' | 'large';

@Component({
  selector: 'storybook-button',
  template: `<button
    type="button"
    (click)="onClick.emit($event)"
    class="storybook-button"
    [ngClass]="{
      'storybook-button--primary': primary,
      'storybook-button--secondary': !primary,
      'storybook-button--small': size === 'small',
      'storybook-button--medium': size === 'medium',
      'storybook-button--large': size === 'large'
    }"
    [ngStyle]="{ 'background-color': backgroundColor }"
  >
    {{ label }}
  </button>`,
  styleUrls: ['./button.component.scss'],
})
export default class ButtonComponent {
  /**
   * Is this the principal call to action on the page?
   */
  @Input()
  get primary() {
    return this._primary;
  }
  set primary(value: BooleanInput) {
    this._primary = coerceBooleanProperty(value);
  }
  private _primary: boolean = false;

  /**
   * What background color to use
   */
  @Input()
  backgroundColor?: string;

  /**
   * How large should the button be?
   */
  @Input()
  size: ButtonSize = 'medium';

  /**
   * Button contents
   *
   * @required
   */
  @Input()
  label = 'Button';

  /**
   * Optional click handler
   */
  @Output()
  onClick = new EventEmitter<Event>();
}

